import { MAIN_ROUTE, MENU_ROUTE, FAMILY_ROUTE, POLICY_ROUTE, ANIMALS_ROUTE, ECOLOGY_ROUTE, NEWS_ROUTE, } from "./const";
import Contact from "./pages/Contact";
import Main from "./pages/Main";
import Menu from "./pages/Menu";
import News from "./pages/News";


export const publicRoutes = [
    {
        path: MAIN_ROUTE,
        Component: Main
    },
    {
        path: CONTACTS_ROUTE,
        Component: Contact
    },
    {
        path: MENU_ROUTE,
        Component: Menu
    },
    {
        path: NEWS_ROUTE,
        Component: News
    }
]
